import React, { Component } from "react";
import "./MissingObjectList.css";
import SportsEquipment from "./SportsEquipment";



class SportsEquipmentList extends Component {
    state = {
        objects:[
          {name: "Balon Futbol", available: true , by: "", borrowed: false, student_name: ""},
          {name: "Raqueta tenis", available: true , by: "", borrowed: false, student_name: ""},
          {name: "Pin pong", available: true , by: "", borrowed: false, student_name: ""},
          {name: "Balon Basket", available: true , by: "", borrowed: false, student_name: ""},
          {name: "Balon Volleyball", available: true , by: "", borrowed: false, student_name: ""},
          {name: "Frisbie", available: true , by: "", borrowed: false, student_name: ""},
          {name: "Remos", available: true , by: "", borrowed: false, student_name: ""},
          
        ]
      }
  render() {
    return (
      <div className="SportsEquipmentList">                         
            {this.state.objects.map(object => <SportsEquipment name = {object.name} available = {object.available} 
         by = {object.by} borrowed={object.borrowed} student_name={object.student_name} />)}               
      </div>
    );
  }
}

export default SportsEquipmentList;
